import React from 'react';
import './App.css';
import Bottom from './Components/Bottom';
import Header from './Components/Header';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <Bottom />
      </header>
    </div>
  );
}

export default App;
